  @override
  String get settings_AboutUsText => 'Este aplicativo é desenvolvido pela associação MAWAQIT.\nA associação MAWAQIT é uma organização sem fins lucrativos criada em 2021 em França.\nO nosso objetivo é o desenvolvimento de soluções inovadoras relacionadas com TI e tecnologia digital, como software e websites; ensinar e treinar em soluções digitais e ferramentas de TI. \nO sistema MAWAQIT é nosso principal produto e sua história começou em 2016, com um aplicativo de tela grande dedicado às mesquitas, depois um aplicativo móvel, um plug-in de assistente doméstico e uma habilidade Alexa, etc. \nMAWAQIT oferece uma nova maneira de monitorar e gerenciar momentos de oração; Na verdade, oferecemos um sistema ponta a ponta que oferece aos administradores de mesquitas uma ferramenta online disponível 24 horas por dia, permitindo-lhes gerir agendas, notícias e informações. muitos outros recursos. Os fiéis, por outro lado, beneficiam de uma aplicação móvel que lhes permite consultar os horários exatos e não aproximados da sua mesquita preferida, bem como notícias e outras funcionalidades como a procura de uma mesquita por geolocalização, o adhan, o qibla ... etc Fazemos da confiabilidade e da qualidade nossos principais valores. Nossa ambição é clara: construir o melhor serviço para nossas mesquitas graças à tecnologia e ao design.\nSe você gostou deste aplicativo, dê sua opinião sobre a loja.';

